- input: "TEXT\x1CC00041269\x1CX0\x1C\x1CF3XA\x1CThis amendment is in response to
    the Commission?s letter dated March 23, 2011 regarding the Committee?s Amended
    30Day Post-General Report.    1.The missing expenditures for Schedule F for Line
    25 have been included in this amendment.  2.The additional receipts for Schedule
    A for Line 12 were transactions provided to us by the DSP Victory Fund. The transactions
    represent activity conducted via a custodial account opened on behalf of the Committee.
    However, the Committee did not receive notice/information regarding these transactions
    from the DSP Victory Fund until after the original Post-General Report had been
    filed. Additionally, In-Kind and MEMO transaction information was not received
    from the Democratic National Committee or the State Party Victory Fund until after
    the reporting period deadline for the original report filing. The additional disbursements
    disclosed on Schedule A for Line 17 were for bank fees, and were discovered during
    routine year-end audit procedures of the Committees accounts.  3.Payments on Schedule
    B for Line 30(b) for ?Printing/Slate Card? and Printing/ & Postage/Slate Card
    did not contain a reference to any candidate for Federal office. They were of
    generic message in nature, and only contained specific reference to non-federal
    candidates. However, these expenditures did meet the definition of Exempt Activities.
    \ 4.The itemized disbursements for ?Reimbursements? have been corrected to provide
    additional information.  5.Missing information on Schedule B for ?Reimbursement?
    has been provided where necessary.  6.The transfer to the Committee?s non federal
    account was strictly for cash flow purposes, and was not for the purpose of reimbursing
    the non federal account for federal expenditures.   7.Missing addresses for disbursements
    on Schedule H4 have been provided.  8.See memo text for transfer to non-federal
    reported on Schedule B for Line 29.  9.The Committee is attempting to reconcile
    the charges and credit posted against the credit card accounts. There have been
    multiple credits and overpayments to the credit cards accounts in question that
    do not necessarily correspond to specific MEMO entries. There were no charges
    made with credit cards that were for federal candidates or their committees. Upon
    acquiring addition information the Committee will amend this and other reports,
    as needed.   10.These entries have been corrected, and additional information
    provided.  \n"
